// Returns the private block signing key of the authority
func authKeyLookup(auth interfaces.IHash) (string, *primitives.PrivateKey, *hardCodedAuthority) {
	key := ""
	var resA hardCodedAuthority
	for _, a := range authKeyLibrary {
		if auth.IsSameAs(a.ChainID) {
			key = a.NewBlockKey
			resA = a
			break
		}
	}
	p, _ := primitives.NewPrivateKeyFromHex(key)
	return key, p, &resA
}

func buildMessages() []hardCodedAuthority {
	list := make([]hardCodedAuthority, STACK_HEIGHT)
	cComs := strings.Split(chainCommit, "#")
	for i := 0; i < len(cComs); i = i + 2 {
		index, err := strconv.Atoi(cComs[i])
		if err != nil {
			continue
		}
		list[index].ChainCommits = append(list[index].ChainCommits, cComs[i+1])
	}
	cRevs := strings.Split(chainReveal, "#")
	for i := 0; i < len(cRevs); i = i + 2 {
		index, err := strconv.Atoi(cRevs[i])
		if err != nil {
			continue
		}
		list[index].ChainReveals = append(list[index].ChainReveals, cRevs[i+1])
	}
	eComs := strings.Split(entryCommit, "#")
	for i := 0; i < len(eComs); i = i + 2 {
		index, err := strconv.Atoi(eComs[i])
		if err != nil {
			continue
		}
		list[index].EntryCommits = append(list[index].EntryCommits, eComs[i+1])
	}
	eRevs := strings.Split(entryReveal, "#")
	for i := 0; i < len(eRevs); i = i + 2 {
		index, err := strconv.Atoi(eRevs[i])
		if err != nil {
			continue
		}
		list[index].EntryReveals = append(list[index].EntryReveals, eRevs[i+1])
	}
	chainIDList := strings.Split(chainIDs, "#")

	for i := 0; i < len(chainIDList); i = i + 2 {
		index, err := strconv.Atoi(chainIDList[i])
		if err != nil {
			continue
		}
		next, err := primitives.HexToHash(chainIDList[i+1])
		if err != nil {
			continue
		}
		list[index].ChainID = next
	}
	subChainIDList := strings.Split(subChainIDs, "#")
	for i := 0; i < len(subChainIDList); i = i + 2 {
		index, err := strconv.Atoi(subChainIDList[i])
		if err != nil {
			continue
		}
		next, err := primitives.HexToHash(subChainIDList[i+1])
		if err != nil {
			continue
		}
		list[index].ManageChain = next
	}
	privList := strings.Split(privates, "#")
	for i := 0; i < len(privList); i = i + 2 {
		index, err := strconv.Atoi(privList[i])
		if err != nil {
			continue
		}
		var p [64]byte
		data, err := hex.DecodeString(privList[i+1])
		if err != nil || len(data) < 64 {
			continue
		}
		copy(p[:64], data[:64])
		list[index].Sk1 = p
	}

	for i, l := range list {
		l.Ready = false
		list[i] = l
		if len(l.ChainCommits) != 2 {
			continue
		}
		if len(l.ChainReveals) != 2 {
			continue
		}
		if len(l.EntryCommits) != 2 {
			continue
		}
		if len(l.EntryReveals) != 2 {
			continue
		}
		if len(l.ChainID.Bytes()) != 32 {
			continue
		}
		l.Ready = true
		list[i] = l
	}
	for _, ele := range list {
		if ele.Ready == true {
			ele.Taken = false
			authStack = append(authStack, ele)
		}
	}

	nextAuthority = 0
	return list
}

func getFactomPackageEntryFromString(message string) (*factom.Entry, error) {
	entry := entryBlock.NewEntry()
	if p, err := hex.DecodeString(message); err != nil {
		return nil, errors.New("Invalid Reveal Entry")
	} else {
		_, err := entry.UnmarshalBinaryData(p)
		if err != nil {
			return nil, errors.New("Invalid Reveal Entry")
		}
		fEntry := new(factom.Entry)
		// build Factom pkg entry.
		fEntry.ChainID = entry.ChainID.String()
		fEntry.ExtIDs = entry.ExternalIDs()
		fEntry.Content = entry.Content.Bytes

		return fEntry, nil
	}
}

func v2Request(req *primitives.JSON2Request, port int) (*primitives.JSON2Response, error) {
	j, err := json.Marshal(req)
	if err != nil {
		return nil, err
	}

	portStr := fmt.Sprintf("%d", port)
	resp, err := http.Post(
		"http://localhost:"+portStr+"/v2",
		"application/json",
		bytes.NewBuffer(j))
	if err != nil {
		return nil, err
	}
	defer resp.Body.Close()

	body, err := ioutil.ReadAll(resp.Body)
	if err != nil {
		return nil, err
	}
	r := primitives.NewJSON2Response()
	if err := json.Unmarshal(body, r); err != nil {
		return nil, err
	}
	return nil, nil
}

func modifyLoadIdentities() {
	chainIDList := strings.Split(chainIDs, "#")

	list := make([]interfaces.IHash, 0)
	for i := 0; i < len(chainIDList); i = i + 2 {
		next, err := primitives.HexToHash(chainIDList[i+1])
		if err != nil {
			continue
		}
		list = append(list, next)
		//list = append([]interfaces.IHash{next}, list...)
	}

	if len(list) == 0 {
		fmt.Println("Error when loading up identities for fnodes")
	}

	for i := 1; i < len(fnodes); i++ {
		if i-1 >= len(list) {
			break
		} else {
			if fnodes[i] == nil {
				continue
			}
			index := i - 1
			if list[index] == nil {
				continue
			}

			// Don't "fix" a simulator entry if it already has a good identity.
			if binary.BigEndian.Uint32(fnodes[i].State.IdentityChainID.Bytes()[:4])>>8 == 0x888888 {
				continue
			}

			fnodes[i].State.IdentityChainID = list[index]
			// Build table of identities to names
			addFnodeName(i)

			buf := new(bytes.Buffer)
			buf.WriteString(list[index].String())
			pub, priv, err := ed.GenerateKey(buf)
			if err != nil {
				continue
			}
			_ = pub

			privkey := primitives.NewPrivateKeyFromHexBytes(priv[:])
			if err != nil {
				continue
			}
			fnodes[i].State.LocalServerPrivKey = privkey.PrivateKeyString()
			fnodes[i].State.SimSetNewKeys(privkey)
		}
	}
}

func addFnodeName(i int) {
	// full name
	name := fnodes[i].State.FactomNodeName
	globals.FnodeNames[fnodes[i].State.IdentityChainID.String()] = name
	// common short set
	globals.FnodeNames[fmt.Sprintf("%x", fnodes[i].State.IdentityChainID.Bytes()[3:6])] = name
	globals.FnodeNames[fmt.Sprintf("%x", fnodes[i].State.IdentityChainID.Bytes()[:5])] = name
	globals.FnodeNames[fmt.Sprintf("%x", fnodes[i].State.IdentityChainID.Bytes()[:])] = name
	globals.FnodeNames[fmt.Sprintf("%x", fnodes[i].State.IdentityChainID.Bytes()[:8])] = name
}

func shad(data []byte) []byte {
	h1 := sha256.Sum256(data)
	h2 := sha256.Sum256(h1[:])
	return h2[:]
}
